import './Intro.css';

import React from 'react';

//apis
// import {BrowserRouter, Routes, Route, Switch} from 'react-router-dom';


function Intro() {

    return (
        <div className='intro'>
            <div className='signup'>
                <p className='main-points white-text'>
                    Building the Next Generation of Index Management
                </p>


                <div className='signup-form'>

                </div>

            </div>
        </div>
    );
}

export default Intro;
